// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Storage.sol";

contract EmployerLogic is Storage {
    error AR_E();
    error WR_E();
    error II_E();

    event EmployerRegistered(address employerAddress, string name);
    event JobCreated(uint jobId, string title);
    event FundsDeposited(uint jobId, address sender, uint amount);
    event FundsReleased(uint jobId, address freelancerAddress, uint amount);

    modifier onlyEmployer() {
        if (roles[msg.sender] != 1) revert WR_E();
        _;
    }

    function getEmployerByAddress(address _employer) external view returns(Employer memory props){
        props = employers[_employer];
    }


    function getEmployerEscrow(address _employer, uint256 _job_id) external view returns(uint){
        return escrowFunds[_employer][_job_id];

    }

    function registerEmployer(string memory _name, string memory _industry, string memory _country, string memory _imageURI) public {
        if (roles[msg.sender] != 0) revert AR_E();
        require(bytes(_name).length > 0);
        require(bytes(_industry).length > 0);

        totalEmployers++;
        roles[msg.sender] = 1;
        employers[msg.sender] = Employer(msg.sender, _name, _industry, 0, _country, _imageURI, true, block.timestamp);

        emit EmployerRegistered(msg.sender, _name);
    }

    function createJob(string memory _title, string memory _description, uint256 _budget) public onlyEmployer {
        totalJobs++;
        uint8 jobId = totalJobs;
             jobs[jobId] = Job(jobId,payable(msg.sender),_title,_description,_budget,false,new address[](0),address(0));    
        emit JobCreated(jobId, _title);
    }

    function depositFunds(uint jobId) public payable onlyEmployer {
        require(jobId > 0 && jobId <= totalJobs, "JDE_E");
        Job storage job = jobs[jobId];
        require(job.employer == msg.sender);
        require(!job.completed, "JNC_E");
        require(msg.value >= job.budget, "IF");

        employers[msg.sender].balance += msg.value;
        escrowFunds[msg.sender][jobId] += msg.value;
        emit FundsDeposited(jobId, msg.sender, msg.value);
    }

    function releaseEscrow(uint jobId, address freelancerAddress) public onlyEmployer {
        require(jobId > 0 && jobId <= totalJobs, "JDE_E");
        Job storage job = jobs[jobId];
        require(job.completed, "JNC_E");

        uint amount = escrowFunds[msg.sender][jobId];
        require(amount > 0, "NFE_E");
        require(amount >= job.budget, "IF");

        escrowFunds[msg.sender][jobId] = 0;
        freelancers[freelancerAddress].balance += amount;
        employers[msg.sender].balance -= amount;
        emit FundsReleased(jobId, freelancerAddress, amount);
    }

     function editEmployerProfile(
        string memory _name,
        string memory _industry,
        string memory _country,
        string memory _imageURI
    ) external onlyEmployer {
        if (bytes(_name).length == 0 || bytes(_industry).length == 0) revert II_E();

        Employer storage employer = employers[msg.sender];
        employer.name = _name;
        employer.industry = _industry;
        employer.country = _country;
        employer.image = _imageURI;
    }
}

contracts/FreelancerLogic.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Storage.sol";

contract FreelancerLogic is Storage {
    error AR_F();
    error WR_F();
    error II_F();

    event FreelancerRegistered(address freelancerAddress, string[] images, uint256 amount);
    event WithdrawFund(address freelancer, uint amount);

    modifier onlyFreelancer() {
        if (roles[msg.sender] != 2) revert WR_F();
        _;
    }

    function registerFreelancer(string memory _name, string memory _skills, string memory _country,
        string memory _gigTitle, string memory _gigDesc, string[] memory _images, uint256 _starting_price
    ) public {
        if (roles[msg.sender] != 0) revert AR_F();
        require(bytes(_name).length > 0);
        require(bytes(_skills).length > 0);

        totalFreelancers++;
        roles[msg.sender] = 2;
        freelancers[msg.sender] = Freelancer(msg.sender, _name, _skills, 0, _country, _gigTitle, _gigDesc, _images, 0, true, block.timestamp, _starting_price);
        allFreelancerAddresses.push(msg.sender);
        emit FreelancerRegistered(msg.sender, _images, _starting_price);
    }

    function editFreelancerProfile(string memory _name, string memory _skills, string memory _country,
        string memory _gigTitle, string memory _gigDesc, string[] memory _images, uint256 _starting_price
    ) external onlyFreelancer {
        if (bytes(_name).length == 0 || bytes(_skills).length == 0) revert II_F();

        Freelancer storage f = freelancers[msg.sender];
        f.name = _name;
        f.skills = _skills;
        f.country = _country;
        f.gigTitle = _gigTitle;
        f.gitDescription = _gigDesc;
        f.images = _images;
        f.starting_price = _starting_price;
    }

    function withdrawEarnings() public onlyFreelancer {
        Freelancer storage f = freelancers[msg.sender];
        require(f.balance > 0, "NBW");

        uint toTransfer = (f.balance * 95) / 100;
        f.balance = 0;
        (bool success, ) = msg.sender.call{value: toTransfer}("");
        require(success, "TF");

        emit WithdrawFund(msg.sender, toTransfer);
    }
}

contracts/JobLogic.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Storage.sol";

contract JobLogic is Storage {
    error YHA();

    event AppliedForJob(uint jobId, address employer, address freelancer);
    event JobCompleted(uint jobId, address freelancer, uint payment);

    function applyForJob(uint jobId) public {
        require(jobId > 0 && jobId <= totalJobs, "JDE");
        Job storage job = jobs[jobId];
        require(job.employer != address(0), "JNF");

        for (uint i = 0; i < job.applicants.length; i++) {
            if (job.applicants[i] == msg.sender) revert YHA();
        }
        job.applicants.push(msg.sender);
        emit AppliedForJob(jobId, job.employer, msg.sender);
    }

    function hireFreelancer(uint jobId, address freelancerAddress) public {
        require(jobId > 0 && jobId <= totalJobs, "JDE");
        Job storage job = jobs[jobId];
        require(job.employer == msg.sender, "WR");
        require(!isFreelancerHired(job, freelancerAddress), "FAH");

        job.hiredFreelancer = freelancerAddress;
    }

    function completeJob(uint jobId, address freelancerAddress) public {
        require(jobId > 0 && jobId <= totalJobs, "JDE");
        Job storage job = jobs[jobId];
        require(job.employer == msg.sender);
        require(isFreelancerHired(job, freelancerAddress), "FNH");

        job.completed = true;
        totalCompletedJobs++;
        freelancers[freelancerAddress].jobsCompleted++;
        emit JobCompleted(jobId, freelancerAddress, job.budget);
    }

    function getJobByID(uint256 jobId) external view returns (Job memory) {
        require(jobId > 0 && jobId <= totalJobs, "JDE");
        return jobs[jobId];
    }

    function allJobs() external view returns (Job[] memory) {
        Job[] memory arr = new Job[](totalJobs);
        for (uint i = 0; i < totalJobs; i++) arr[i] = jobs[i+1];
        return arr;
    }

    function isFreelancerHired(Job storage job, address freelancer) internal view returns (bool) {
        return job.hiredFreelancer == freelancer;
    }
}

