// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "./Storage.sol";

contract Proxy {
    address public implementation;

    constructor(address _implementation, bytes memory _initData) {
        implementation = _implementation;
        (bool success, bytes memory data) = _implementation.delegatecall(_initData);
        if (!success) {
            assembly {
                revert(add(data, 32), mload(data))
            }
        }

    }

    fallback() external payable {
        address impl = implementation;
        assembly {
            calldatacopy(0, 0, calldatasize())
            let result := delegatecall(gas(), impl, 0, calldatasize(), 0, 0)
            returndatacopy(0, 0, returndatasize())
            switch result
            case 0 { revert(0, returndatasize()) }
            default { return(0, returndatasize()) }
        }
    }

    receive() external payable {}
}

contracts/Storage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Storage {
    address public owner;
    uint8 public totalJobs;
    uint public totalFreelancers;
    uint public totalEmployers;
    uint public totalCompletedJobs;

    struct Job {
        uint8 id;
        address employer;
        string title;
        string description;
        uint256 budget;
        bool completed;
        address[] applicants;
        address hiredFreelancer;
    }

    struct Freelancer {
        address freelancerAddress;
        string name;
        string skills;
        uint balance;
        string country;
        string gigTitle;
        string gitDescription;
        string[] images;
        uint jobsCompleted;
        bool registered;
        uint256 registration_date;
        uint256 starting_price;
    }

    struct Employer {
        address employerAddress;
        string name;
        string industry;
        uint balance;
        string country;
        string image;
        bool registered;
        uint256 registration_date;
    }

    mapping(uint256 => Job) public jobs;
    mapping(address => Freelancer) public freelancers;
    mapping(address => Employer) public employers;
    mapping(address => mapping(uint256 => uint)) public escrowFunds;
    mapping(address => uint8) public roles;
    address[] public allFreelancerAddresses;
}

